UPDATE test_definition
SET is_separate_page = '0'
WHERE report_type_id in
(
SELECT RID
FROM lkp_report_type
WHERE CODE = 'CBC'
OR CODE = 'STOOL'
)


UPDATE test_definition
SET is_separate_page = '1'
WHERE report_type_id in
(
SELECT RID
FROM lkp_report_type
WHERE CODE ='ALLERGY'
OR CODE = 'CULTURE'
OR CODE = 'PROTEIN_ELECTRO'
OR CODE = 'URINE'
)

